  const { data: featuredTours,loading,error} = useFetch(`${BASE_URL}/tours/search/getFeaturedTours`) ;
  console.log(featuredTours) 
  return <>
  {}
    {
      featuredTours?.map(tour=>(
        <Col lg='3' className='mb-4' key={tour.id}><TourCard tour={tour}/></Col>
      ))
    }
    </>
}

